import "./App.css";
import {useState} from "react";
// import ReactDOMServer from "react-dom/server";

function App() {
	const challenges = [
		["NBA Points", "Mr. Schlenker", "NBA Points Challenge - CSML 1022.pdf"],
		["Polling", "Andrew Young", "Polling Data Challenge - CSML 1022.pdf"],
	];
	const [currentChallenge, setChallenge] = useState(challenges[0]);

	const handleClick = (index) => {
		setChallenge(challenges[index]);
		console.log(currentChallenge);
	};

	return (
		<div>
			{/* className="grid grid-cols-3" */}
			<div className="col-span-1 mx-auto flex flex-col my-12 w-5/6 space-y-10 overflow-auto">
				{challenges.map((challenge, index) =>
					challenge === currentChallenge ? (
						<div className="overflow-auto relative mx-auto flex flex-col w-full">
							<div href="#" class=" float-right block p-6 bg-white rounded-lg border border-gray-200 shadow-md dark:bg-gray-800 dark:border-gray-700 space-y-5">
								<h2 class="text-4xl font-extrabold dark:text-white">{currentChallenge[0]}</h2>
								<p class="font-normal text-gray-700 dark:text-gray-400">{currentChallenge[1]}</p>
								<iframe src={process.env.PUBLIC_URL + currentChallenge[2]} width="100%" height="500px"></iframe>

								<label for="message" class="block mb-2 text-sm font-medium text-gray-900 dark:text-gray-400">
									Compare your code to the optimal solution
								</label>
								<textarea id="message" rows="4" class="block p-2.5 w-full text-sm text-gray-900 bg-gray-50 rounded-lg border border-gray-300 focus:ring-blue-500 focus:border-blue-500 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder="Paste your code..."></textarea>
								<button type="button" class="text-white bg-blue-700 hover:bg-blue-800 focus:ring-4 focus:ring-blue-300 font-medium rounded-lg text-sm px-5 py-2.5 mr-2 mb-2 dark:bg-blue-600 dark:hover:bg-blue-700 focus:outline-none dark:focus:ring-blue-800">
									Compare
								</button>
							</div>
						</div>
					) : (
						<div onClick={() => handleClick(index)} class="cursor-pointer block p-6 bg-white rounded-lg border border-gray-200 shadow-md hover:bg-gray-100 dark:bg-gray-800 dark:border-gray-700 dark:hover:bg-gray-700">
							<h5 class="mb-2 text-2xl font-bold tracking-tight text-gray-900 dark:text-white">{index}. {challenge[0]}</h5>
							<p class="font-normal text-gray-700 dark:text-gray-400">{challenge[1]}</p>
						</div>
					)
				)}
			</div>
		</div>
	);
}

export default App;
